class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        plen = len(p)
        slen = len(s)
        if not s: return []
        ps = sorted(p)
        res = []
        for i in range(len(s)-plen+1):
            if i > 0 and s[i-1] == s[i+plen-1]:
                pass
            else:
                a = sorted(s[i:i+plen])
            if a == ps: res.append(i)
        return res

